It's an honor to be a part of such an amazing project. 
REPOST @kellybehunstudio "excited to share a recent project of ours, a penthouse pied a terre in one of my favorite residential buildings in Manhattan, the striking and sinuous Herzog & de Meuron building in the West Village.
Our chic clients, based in London, have 3 small children and wanted a place that felt distinctly different from their home in Notting Hill. With its curvy walls of glass and endless views of the Hudson River and south across lower
Manhattan, this space feels quintessentially New York. Interiors by Kelly Behun Studio / styled by @katjagreeff /photos by
